//merge sort
class Solution {
    public:
        ListNode *sortList(ListNode *head) {
            if(!head || !head->next) {
                return head;
            }

            ListNode *p = getMid(head);
            ListNode *next = p->next;
            p->next = nullptr;

            return mergeList(sortList(head), sortList(next));
        }

    private:
        ListNode *getMid(ListNode *head) {
            ListNode *slow = head, *fast=head->next;
            while(fast && fast->next) {
                slow = slow->next;
                fast = fast->next->next;
            }

            return slow;
        }

        ListNode *mergeList(ListNode *first, ListNode *second) {
            if(!second) {
                return first;
            }

            ListNode *head, *p1, *p2;
            if(first->val <= second->val) {
                head = p1 =  first;
                p2 = second;
            } else {
                head = p1 = second;
                p2 = first;
            }

            while(p1->next && p2) {
                if(p1->next->val <= p2->val) {
                    p1 = p1->next;
                } else {
                    ListNode *tmp = p1->next;
                    p1->next = p2;
                    p1 = p2;
                    p2 = tmp;
                }
            }
            p1->next = p2;

            return head;
        }
};

void print(ListNode *head) {
    while(head) {
        cout << head->val << " ";
        head = head->next;
    }
    cout << endl;
}

ListNode *mkList(const char *str) {
    ListNode *head=nullptr, *p=nullptr;
    const char *begin = str;
    char *end;
    for(int val = strtol(begin, &end, 10); begin != end;
            val = strtol(begin, &end, 10)) {
        begin = end + 1;
        ListNode *node = new ListNode(val);
        if(!head) {
            p = head = node;
        } else {
            p->next = node;
            p = node;
        }
    }

    return head;
}

